          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "It just doesn&#39;t make any sense to me. And it makes me angry! :D But I&#39;m learning to live with it. Maybe one day I&#39;ll understand. Or I won&#39;t, it doesn&#39;t matter. But the idea that you can &quot;stretch a second&quot; is just crazy at this point.",
