          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "I understand these examplesbut I still don&#39;t understand the theory of relativity...",
            "textOriginal": "I understand these examplesbut I still don't understand the theory of relativity...",
            "authorDisplayName": "Bi Si",
            "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu9fFDBbp7xPqH59ETxKJKyuZTpo4rDpmq7-IuZjfA=s48-c-k-c0x00ffffff-no-rj",
