    {
      "kind": "youtube#commentThread",
      "etag": "BtWYj5RLqrVU0sabs5dlBL0kfso",
      "id": "UgzY4eq0jzK5dUqDMUB4AaABAg",
      "snippet": {
        "videoId": "yuD34tEpRFw",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "xeyrjxmJfThuGgG8TQrELMyCWuM",
          "id": "UgzY4eq0jzK5dUqDMUB4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Einstein should had introduced third postulate that, speed of light is limiting speed of any object. Though this is informally third postulate of theory of relativity. The mathematics developed for theory of relativity has multiplication factor having this limiting factor which let not exceed speed of an object more than speed of light.\u003cbr\u003e\u003cbr\u003eThis is never demonstrated that speed of light have such value and not affected by relative motion. If light is excluded from relative motion than it should have some property which makes it so. No wave has rest mass because wave carries effect not matter with thembut waves are subjected to relative motion. A particle doesn’t need medium to travel but subjected to relative motion.\u003cbr\u003e\u003cbr\u003eDoppler effect clearly shows that shift in frequency depends upon relative change in speed of lightbut they inverted the order so red became blue and blue became red. Expression of length contraction and time dilation from Michelson-Morley experiment shows that to keep light as constant, changes in length and time has to be done while relativity means change in speed.\u003cbr\u003e\u003cbr\u003eInterpretation of above MM experiment doesn’t infer that speed of light is invariant to relative motionbut relative speed of Earth could not be found in given experiment. If speed of light is constant then there should be fringe shift, because there is difference in spped of light and moving frame of Earth. But that was not detected it means the difference is covered by gain and loss in speed of light due to relative motion.",
            "textOriginal": "Einstein should had introduced third postulate that, speed of light is limiting speed of any object. Though this is informally third postulate of theory of relativity. The mathematics developed for theory of relativity has multiplication factor having this limiting factor which let not exceed speed of an object more than speed of light.\n\nThis is never demonstrated that speed of light have such value and not affected by relative motion. If light is excluded from relative motion than it should have some property which makes it so. No wave has rest mass because wave carries effect not matter with thembut waves are subjected to relative motion. A particle doesn’t need medium to travel but subjected to relative motion.\n\nDoppler effect clearly shows that shift in frequency depends upon relative change in speed of lightbut they inverted the order so red became blue and blue became red. Expression of length contraction and time dilation from Michelson-Morley experiment shows that to keep light as constant, changes in length and time has to be done while relativity means change in speed.\n\nInterpretation of above MM experiment doesn’t infer that speed of light is invariant to relative motionbut relative speed of Earth could not be found in given experiment. If speed of light is constant then there should be fringe shift, because there is difference in spped of light and moving frame of Earth. But that was not detected it means the difference is covered by gain and loss in speed of light due to relative motion.",
            "authorDisplayName": "Neil Libertine",
            "authorProfileImageUrl": "https://yt3.ggpht.com/jqeSriKwdfdTAyBtI2--76R71CJibEaijBEEJPVs-CcpyK3HGnkNZItJQU8z4dVRQmgc3P_w=s48-c-k-c0x00ffffff-no-rj",
            "authorChannelUrl": "http://www.youtube.com/channel/UC35cKjwzdRtI-PHvy7ZFViA",
            "authorChannelId": {
              "value": "UC35cKjwzdRtI-PHvy7ZFViA"
