    {
      "kind": "youtube#commentThread",
      "etag": "sY2FPLj6n8VrXfvwoyCaSDstBzo",
      "id": "UgyYT0U_w9_leZOSQrx4AaABAg",
      "replies": {
        "comments": [
          {
            "kind": "youtube#comment",
            "etag": "3yTAvR5jyJdQshla_c3qLhPFx3M",
            "id": "UgyYT0U_w9_leZOSQrx4AaABAg.8f6lgb-6n1D8sjaTBVufwE",
            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "@Albir Tarsha The Michelson-Morley experiment was performed to demonstrate the presence or absence of ether wind, which is different from detecting red- or blueshift phenomenons. The Michelson-Morley experiment nullifies the effects on red-blue-shift results and any differences of duration by sending the light beam back AND forth. Whatever red-shift might occur in the beam that penetrates the mirror towards the East, is compensated by the same beam being reflected back West. And whatever additional time it might take the beam to travel East, that difference is compensated by the beam travelling back West after being reflected. The Michelson-Morley experiment was flawed by concept.\u003cbr\u003e\u003cbr\u003e\u003cbr\u003eImagine my experiment like this:\u003cbr\u003e- 3 light sources at equal distance to the receiver, spread out in the x,y and z axis.\u003cbr\u003e- They send a light beam to the receiver.\u003cbr\u003e- Since the receiver is likely moving in absolute terms (100&#39;000km/h around the sun), there should be two effects:\u003cbr\u003e1) the light beam that directs the light in the direction of the receivers absolute motion will take the longest to reach the receiver (since the receiver moves away from the source). The distance for the light to travel is longer. Given the speed of light being equal, when the distance is longer, it will take longer to reach the target.\u003cbr\u003e2) the light received will vary in wave length and be slightly shifted to red.\u003cbr\u003eThe opposite will be true if the light source is directed to the receiver that is moving towards it (in absolute terms)\u003cbr\u003e\u003cbr\u003eBy taking the different results (duration, wave length) from the different light sources into consideration, one should be able to calculate and determine the absolute motion of our system (earth) in reference to  frame of reference that is standing still in absolute terms.\u003cbr\u003e\u003cbr\u003e\u003cbr\u003eOnce we know the absolute vector of the motion of our system, I am sure many other discrepancies in the realm of relativity and special relativity will fall in place (probably overthrowing some generally accepted theories). I am also quite sure that once this is all sorted out, we will be able to tackle the phenomenon of gravity and start to understand it and its effects better. Wouldn&#39;t it be great to get a bit closer to the unifying theory of everything? \u003cbr\u003e\u003cbr\u003e\u003cbr\u003eUnfortunately, my status is one of a thinker and not of a scientist, so I don&#39;t have a lab nor the math to prove anything. I leave that to people who will pick up this ball and run with it. :)",
              "textOriginal": "@Albir Tarsha The Michelson-Morley experiment was performed to demonstrate the presence or absence of ether wind, which is different from detecting red- or blueshift phenomenons. The Michelson-Morley experiment nullifies the effects on red-blue-shift results and any differences of duration by sending the light beam back AND forth. Whatever red-shift might occur in the beam that penetrates the mirror towards the East, is compensated by the same beam being reflected back West. And whatever additional time it might take the beam to travel East, that difference is compensated by the beam travelling back West after being reflected. The Michelson-Morley experiment was flawed by concept.\n\n\nImagine my experiment like this:\n- 3 light sources at equal distance to the receiver, spread out in the x,y and z axis.\n- They send a light beam to the receiver.\n- Since the receiver is likely moving in absolute terms (100'000km/h around the sun), there should be two effects:\n1) the light beam that directs the light in the direction of the receivers absolute motion will take the longest to reach the receiver (since the receiver moves away from the source). The distance for the light to travel is longer. Given the speed of light being equal, when the distance is longer, it will take longer to reach the target.\n2) the light received will vary in wave length and be slightly shifted to red.\nThe opposite will be true if the light source is directed to the receiver that is moving towards it (in absolute terms)\n\nBy taking the different results (duration, wave length) from the different light sources into consideration, one should be able to calculate and determine the absolute motion of our system (earth) in reference to  frame of reference that is standing still in absolute terms.\n\n\nOnce we know the absolute vector of the motion of our system, I am sure many other discrepancies in the realm of relativity and special relativity will fall in place (probably overthrowing some generally accepted theories). I am also quite sure that once this is all sorted out, we will be able to tackle the phenomenon of gravity and start to understand it and its effects better. Wouldn't it be great to get a bit closer to the unifying theory of everything? \n\n\nUnfortunately, my status is one of a thinker and not of a scientist, so I don't have a lab nor the math to prove anything. I leave that to people who will pick up this ball and run with it. :)",
              "parentId": "UgyYT0U_w9_leZOSQrx4AaABAg",
              "authorDisplayName": "Michi Uno",
