            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "@Albir Tarsha  In this context: Should we not be able to determine an absolute still frame of reference by performing an experiment as follows:\u003cbr\u003eWe create a scientifically correct environment to measure the speed of light in a vacuum. Then we place a light receiving instrument in the center of the experiment and measure the wave lengths of equal light sources placed around the receiver. Since light travels at an universally equal speed, our own motion in the universe (earth, solar system, galaxy...) moves the receiver in a certain direction at a certain speed. Light sent out from the various sources around the receiver should now be received with different wave lenghts shifts (like red-shift). If the receiver moves away from the light source, the wave length should be longer - coloring the light red. Motion towards the light source makes the wave length shorter - coloring it blue. By combining the results of these measurements, we should be able to calculate our direction and speed in the universe.",
